description:
For Sale;

Vintage 1973 Kimberly electric guitar bought new at Lafayette Radio Electronics. 2 pickup Apollo(?) model. Yellow sunburst finish.  100% original and complete. Plays and sounds very surfy. Easy to play low action set-up. No breaks or repairs. Same owner for 40 years. Well taken care of. Being sold with original case. 
$250.00 FIRM

Up for sale is a ton of gear that I love, but don't use as often as I'd like and would like to see go to a good home. Everything is in excellent condition unless otherwise noted. Will consider any reasonable offers.

Pedals Available:

Boss DD-7;
Boss RV-3;
ProCo Rat (Robert Keeley Mod);
Boss DD-5;
SiB Mr. Echo (some issues with the knobs).

Guitar/Amp/Synth Available:

Fender '65 Twin Reverb w/casters and Fender amp cover;
Jay Turser Surfmaster (3-color sunburst) stock;
Alesis Micron Synthesizer (red);
Alesis Midi Controller.
